import React from "react";

function Home() {
  return (
    <div className="home">
      <div className="about">
        <h2>Hello, my name is Christian</h2>
        <div className="prompt">
          <p>A web developer with a passion for learning.</p>
        </div>
      </div>
      <div className="skills">
        <h1>Skills</h1>
        <ol>
          <li className="softskill">
            <h3> Front-End Development</h3>
          </li>
        </ol>
      </div>
    </div>
  );
}
export default Home;
